import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate, Link } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import ProductManagement from './components/ProductManagement';
import UserManagement2 from './components/userManagement2'; // Renaming to PascalCase for consistency
import SignUp from './components/SignUp';


const App = () => {
    const [isAuthenticated, setIsAuthenticated] = useState(false);
    const [products, setProducts] = useState([
        { id: 1, name: 'Chicken Wings', category: 'Food', quantity: 50, price: 10 },
        { id: 2, name: 'Soda', category: 'Beverage', quantity: 100, price: 1.5 },
    ]);
    const [users, setUsers] = useState([]);

    const handleLogin = () => setIsAuthenticated(true);
    const handleLogout = () => setIsAuthenticated(false);

    return (
        <Router>
            <marquee style={styles.marquee}>Limkokwing Wings Cafe</marquee>
            <div>
                <nav style={styles.nav}>
                    {isAuthenticated && (
                        <>
                            <Link to="/dashboard" style={styles.navLink}>Dashboard</Link>
                            <Link to="/products" style={styles.navLink}>Product Management</Link>
                            <Link to="/users2" style={styles.navLink}>User Management</Link>
                            <Link to="/login" style={styles.navLink} onClick={handleLogout}>Logout</Link>
                        </>
                    )}
                </nav>

                <Routes>
                    <Route 
                        path="/login" 
                        element={isAuthenticated ? <Navigate to="/dashboard" /> : (
                            <div style={styles.loginContainer}>
                                <h2 style={styles.title}>Login</h2>
                                <form onSubmit={(e) => { e.preventDefault(); handleLogin(); }} style={styles.form}>
                                    <input type="text" placeholder="Username" required style={styles.input} />
                                    <input type="password" placeholder="Password" required style={styles.input} />
                                    <button type="submit" style={styles.button}>
                                        Login
                                    </button>
                                </form>
                                <Link to="/signup" style={styles.signUpLink}>Sign In</Link>
                            </div>
                        )}
                    />
                    <Route path="/signup" element={<SignUp />} /> {/* New sign-up route */}
                    <Route path="/products" element={isAuthenticated ? <ProductManagement products={products} setProducts={setProducts} /> : <Navigate to="/login" />} />
                    <Route path="/dashboard" element={isAuthenticated ? <Dashboard products={products} /> : <Navigate to="/login" />} />
                    <Route path="/users2" element={isAuthenticated ? <UserManagement2 users={users} setUsers={setUsers} /> : <Navigate to="/login" />} />
                    <Route path="/" element={<Navigate to="/login" />} />
                </Routes>
            </div>
        </Router>
    );
};

const styles = {
    marquee: {
        background: '#333',
        color: '#fff',
        padding: '1.5rem', // Increased padding for larger size
        fontSize: '1.5rem', // Increased font size
        fontWeight: 'bold',
    },
    nav: {
        background: 'linear-gradient(90deg, #00c6ff, #0072ff)', // Soft gradient from light blue to blue
        padding: '1rem',
        display: 'flex',
        justifyContent: 'center',
    },
    navLink: {
        color: '#fff', // White color for links
        textDecoration: 'none',
        margin: '0 1.5rem',
        fontSize: '1.2rem', // Increased font size for navigation
        transition: 'color 0.3s', // Smooth transition for hover effect
    },
    loginContainer: {
        textAlign: 'center',
        margin: '2rem auto',
        padding: '2rem',
        maxWidth: '400px',
        borderRadius: '8px',
        background: '#2193b0',
        color: '#fff',
    },
    title: {
        fontSize: '1.8rem', // Increased font size for title
    },
    form: {
        display: 'flex',
        flexDirection: 'column',
        gap: '1rem',
    },
    input: {
        margin: '0.5rem 0',
        padding: '0.8rem', // Increased padding for inputs
        fontSize: '1rem', // Increased font size for inputs
        borderRadius: '4px',
        border: '1px solid #fff',
    },
    button: {
        padding: '0.8rem 1.5rem', // Increased padding for button
        background: 'green',
        color: '#fff',
        border: 'none',
        borderRadius: '4px',
        cursor: 'pointer',
        fontSize: '1rem', // Increased font size for button
    },
    signUpLink: {
        color: '#fff',
        textDecoration: 'none',
        marginTop: '1rem',
        display: 'inline-block',
        fontSize: '1rem', // Increased font size for Sign In link
    },
};

export default App;
